import React from 'react';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from 'react-router-dom';

import About from "./component/About";
import "./App.css";

import Blog123 from "./component/Blog123";
import Contact from "./component/Contact";
import Blog from "./component/Blog";
import Footer from "./component/Footer";
import Home from "./component/Home";
import Project from "./component/Project";
import Service from "./component/Service";
import About1 from "./component/About1";
import Slider from "./Slider";
// import Slider1 from "./pages/Slider1";




function App() {
  return (

    <Router>
      <main>
        <Switch>
<Route path="/" exact>
<Home/>
</Route>
<Route path="/about" exact>
  <About/>
</Route>
<Route path="/" exact>
< Slider />
</Route>
<Route path="/" exact>
< About1 />
</Route>
<Route path="/" exact>
<  Service />
</Route>
<Route path="/" exact>
< Project />
</Route>
<Route path="/" exact>
< Blog />
</Route>
<Route path="/" exact>
< Blog123 />
</Route>
<Route path="/" exact>
< Contact />
</Route>
<Route path="/" exact>
< Footer />
</Route>
<Redirect to="./" />
</Switch>
      </main>
    </Router>
    // <div className="App">
    //   {/* <Slider1/> */}

    //    <Home />

    //    <About />
    //    <Slider /> 
    //    <About1 />
    //    <Service />
    //    <Project />
    //    <Blog />


    //    <Blog123/>
    //    <About1/>

    //    <Contact />

    //    <Footer />

    // </div>
  );
}

export default App;
